import React, { Component } from "react";

class AgentEdit extends Component {
  componentDidMount = props => {
    let i = props.location.state.id;
    let a = props.location.state.agent;
    let t = props.location.state.type;
    console.log(i + a + t);
  };
  render() {
    return (
      <div>
        <p />
      </div>
    );
  }
}

export default AgentEdit;
